
$(document).ready(function () {
  const urlPDF = "./CV_Carlier_Esteban.pdf";
  
  $('header').append(`<table>
  <tr> <button style="margin-left: 40%; margin-top: 3%;" id="BtnImpression"> Télécharger le PDF</button></tr>
  <tr><button style="margin-left:  5px; margin-top: 3%;" id="BtnOuvrir"> Ouvrir le PDF</button></tr>
  </table>
  `)

  $('#BtnImpression').off('click').on('click', function () {
    console.error(urlPDF);
 //   window.open(urlPDF, '_blank');
    download("data:image/pdf;base64,", 'CV_Carlier_Esteban.pdf');
 
  })

  function download(Data, filename) {
    fetch(Data)
      .then(response => response.blob())
      .then(blob => {
        const link = document.createElement("a");
        link.href = URL.createObjectURL(blob);
        link.download = filename;
        link.click();
    })
    .catch(console.error);
  }
  
  $('#BtnOuvrir').off('click').on('click', function () {
    console.error(urlPDF);
   window.open(urlPDF, '_blank');
  })

});



